How to use $slice a $filter result in MongoDB?<p>I have a item collection with the following format:</p>

<pre><code>{
    "_id": 123,
    "items": [{
        "name": "item1",
        "status" : "inactive",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    },
    {
        "name": "item2",
        "status" : "active",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    },
    {
        "name": "item3",
        "status" : "active",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    },
    {
        "name": "item4",
        "status" : "inactive",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    },
    {
        "name": "item5",
        "status" : "active",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    }
    ]
}
</code></pre>

<p>I want to query on status field of items such that the object with status as 'active' is only returned in the array and also skip last 1 and limit 2 are returned in the query.</p>

<p>At present I am using $filter(aggregation) for this operation, by using following query it return only last record:</p>

<pre><code>db.item.aggregate([
    { "$match": { "items.status": "active" } }, 
    { "$project": { 
        "items": { 
            "$slice": [ 
                { "$filter": { 
                    "input": "$items",
                    "as": "item", 
                    "cond": { "$eq": [ "$$item.status", "active" ] } 
                }}, 
                -1,2 
            ] 
        } 
    }}
])
</code></pre>

<p>Output should be:</p>

<pre><code>{
    "_id": 123,
    "items": [
{
        "name": "item2",
        "status" : "active",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    },
    {
        "name": "item3",
        "status" : "active",
        "created" : ISODate("2018-02-14T10:39:28.321Z")
    }]
}
</code></pre>

<p>Please help me to achieve this result.</p>

