How to join between two collections when foreign key in an array of ObjectIs's<p>Let's say I have the following collection structure for mongodb: </p>

<ul>
<li><p>users</p>

<ul>
<li>id</li>
<li>userId</li>
<li>emailAddress</li>
</ul></li>
<li><p>products</p>

<ul>
<li>id</li>
<li>sku</li>
<li>price</li>
</ul></li>
<li><p>productRewards</p>

<ul>
<li>products: [{productId}],</li>
<li>pointsNeeded</li>
<li>rewardAmount</li>
</ul></li>
<li><p>productUsers</p>

<ul>
<li>productId</li>
<li>userId</li>
</ul></li>
</ul>

<p>The mongoose schema is listed below:</p>

<pre><code>UserSchema: Schema = new Schema({
    userName: {type: Schema.Types.String, minlength: 6, maxlength: 10, required: true},
    emailAddress: {type: Schema.Types.String, minlength: 8, maxlength: 55, required: true}
}

ProductSchema: Schema = new Schema({
    sku: {type: Schema.Types.String, minlength: 1, maxlength: 30, required: true},
    price: {type: Schema.Types.Number, required: true}
}

ProductRewardSchema: Schema = new Schema({
    products: [{productId: {type: Schema.Types.ObjectId, required: true, ref: 'product'}}],
    pointsNeeded: {type: Schema.Types.Number, required: true},
    rewardAmount: {type: Schema.Types.Number, required: true}
}

ProductUserSchema: Schema = new Schema({
    productId: {type: Schema.Types.ObjectId, ref: 'product'},
    userId: {type: Schema.Types.ObjectId, ref: 'user'}
}
</code></pre>

<p>DB Version: 3.6</p>

<p>and I need to calculate the points users have accumulated to determine the rewards they are eligibility for.  How should I perform this in mongodb?  I know how this could be done in sql just not nosql.</p>

<p>I am trying something like this but am not sure this is right:</p>

<pre><code>db.productUsers.aggregate(
    { "$unwind": "productRewards.products" },
    {
        "$lookup": {
            from: "productRewards",
            localField: "productRewards.products.productId",
            foreignField: "productId",
            as: "rewards"
        }
    },
    {
        "$group": {
            userId: "$userId", productId: "$productId", total:  { $sum: "$price" }
        }
    },
    {
        "$project": {
            userId: 1,
            productId: 1,
            total: 1
        }
    }
)
</code></pre>

<p>Additionally I am expecting a json output like this:</p>

<p>{ "userId": "ObjectId string", "name": "product name string", "total": 50 }</p>

