<p>{ "userId": "ObjectId string", "name": "product name string", "total": 50 }</p>; Answer: You should be *quite* capable of determining the issue with that error. You **cannot** pass a `string` object, you **must** pass a `List<string>` object: split your input on each newline and then add each line to a `List<string>` to send to the function.

