<pre><code>    router.post('/:id', urlencodedParser, function(req, res) {
        const id = req.params.id;

        // casting validate
        if (id.match(/^[0-9a-fA-F]{24}$/)) {
            if (id != undefined || id != '') {
                // Submit modified album
                album.findById(id, function(err, doc) {
                    // Update related(existed) record with old album info
                    photo.find({"album.catalog": doc.catalog}, function(err, items, next) {
                        // Update each record with new album info
                        items: items.map(function(item) {
                            item.album.title = req.body.title;
                            item.album.catalog = req.body.catalog;
                        })
                        // Try to save the documents above.
                        items.save(); // The problem is here!
                    })
                ...
            }
        }
    });
</code></pre>

<p>The EDIT js file is supposed to modify the album's title and album's catalog which I've already done that. Somehow, I found if the album is changed. Some records which have the old album info should be changed at the same time. So, I find out all the matched records. And I not only find out them correctly. And I assigned them with new values successfully.</p>

