<p>I can create items from an input form and have them successfully save to the Mongo database and the page. I can't figure out how to delete each item based on a button click both on the page and from the database. Ideally, I want to target them based on the <code>_id</code> that Mongo creates.</p>

<p>I think the issue might be having something to do with the way I'm trying to select each item. Any suggestions or easier ways to implement this would be great! </p>

<p>Here is my code for Express:</p>

<pre><code>// Connecting Mongo DB
